        style={{
          textAlign: "center",
          padding: "3rem 2rem",
          maxWidth: "600px",
          margin: "0 auto",
        }}>
        {/* Success Icon */}
        <div
          style={{
            width: "100px",
            height: "100px",
            borderRadius: "50%",
            backgroundColor: "#28a745",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            margin: "0 auto 2rem auto",
            fontSize: "3rem",
            color: "white",
          }}>
          ✓
        </div>

        <h1
          style={{
            color: "#28a745",
            marginBottom: "1rem",
            fontSize: "2.5rem",
          }}>
          Payment Successful!
        </h1>

        <p
          style={{
            fontSize: "1.2rem",
            color: "#666",
            marginBottom: "1rem",
          }}>
          Thank you for your order! Your payment has been processed
          successfully.
        </p>

        <p
          style={{
            fontSize: "1rem",
            color: "#888",
            marginBottom: "2rem",
          }}>
          You will receive an email confirmation shortly with your order details
          and tracking information.
        </p>

        <div
          style={{
            display: "flex",
            gap: "1rem",
            justifyContent: "center",
            flexWrap: "wrap",
          }}>
          <Link
            to="/profile"
            style={{
              padding: "1rem 2rem",
              backgroundColor: "#007bff",
              color: "white",
              textDecoration: "none",
              borderRadius: "8px",
              fontSize: "1.1rem",
              fontWeight: "bold",
              display: "inline-block",
              transition: "background-color 0.2s",
            }}
            onMouseOver={(e) => (e.target.style.backgroundColor = "#0056b3")}
            onMouseOut={(e) => (e.target.style.backgroundColor = "#007bff")}>
            View My Orders
          </Link>

          <Link
            to="/products"
            style={{
              padding: "1rem 2rem",
              backgroundColor: "white",
              color: "#007bff",
              textDecoration: "none",
              border: "2px solid #007bff",
              borderRadius: "8px",
              fontSize: "1.1rem",
              fontWeight: "bold",
              display: "inline-block",
              transition: "all 0.2s",
            }}
            onMouseOver={(e) => {
              e.target.style.backgroundColor = "#007bff";
              e.target.style.color = "white";
            }}
            onMouseOut={(e) => {
              e.target.style.backgroundColor = "white";
              e.target.style.color = "#007bff";
            }}>
            Continue Shopping
          </Link>
        </div>

        {/* Additional Info */}
        <div
          style={{
            marginTop: "3rem",
            padding: "1.5rem",
            backgroundColor: "#f8f9fa",
            borderRadius: "8px",
            border: "1px solid #dee2e6",
          }}>
